import { API_DOG } from "../constants/Api.constants";

class DogService{

    /*async getAllBreeds(){
        const response = await fetch(API_DOG.BREEDS());
        return response.json();
    }
    async getBreedsById(id){
        const response = await fetch(API_DOG.BREEDS_BY_ID());
        return response.json();
    }*/
    async getAllBreeds(){
        const response = await fetch(API_DOG.BREEDS());
        return response.json();
    }
}

export default new DogService();
